import React from 'react';
import { Category } from "../data";


const FilterWithCategories = () => {
    return (
        <Left>
            <Container>
                <Wraper>
                    <Category>Categories</Category>
                    <CategoryContainer>
                        {menCategory.map((item) => (
                            <Category item={item} key={item['menCategory'].id} />
                        ))}
                    </CategoryContainer>
                </Wraper>
            </Container>
        </Left>
    )
}

export default FilterWithCategories
